INSERT INTO `inmuebles_carteles` (`id`, `plantilla_id`, `agente_id`, `html`, `fecha`, `inmueble_id`, `idioma_id`, `impreso`) VALUES
(16, 6, 2, '<p>\r\n	<span style="float: left;"><img width="80" height="80" src="%base_url%uploads/inmuebles/5/codigo_qr.png" /></span><img alt="" src="%base_url%uploads/logo.jpg" style="width: 200px; height: 60px; float: right;" /></p>\r\n<p style="text-align: center;">\r\n	&nbsp;</p>\r\n<p style="text-align: center;">\r\n	&nbsp;</p>\r\n<p style="text-align: center;">\r\n	&nbsp;</p>\r\n<p style="text-align: center;">\r\n	<strong><span style="font-size:20px;"><span style="font-family: lucida sans unicode,lucida grande,sans-serif;">Oficina en pleno centro de Almería</span></span></strong></p>\r\n<div>\r\n	<p style="text-align: center;">\r\n		<span style="font-size:16px;">4 habitaciones, 1 ba&ntilde;os, 135.000 &euro;</span></p>\r\n	<p style="text-align: center;">\r\n		<img width="600" height="400" src="%base_url%uploads/inmuebles/5/imagenes/002-armadale-house-mitsuori-architects-1050x700.jpg" /></p>\r\n	<p style="text-align: justify;">\r\n		<span style="font-size:16px;"><p>\r\n	Este <strong>amplio &aacute;tico</strong> nos recibe con un amplio sal&oacute;n comedor, una espaciosa cocina, y una amplia terraza con orientaci&oacute;n sur y oeste, desde esta terraza se tienen vistas al mar Mediterr&aacute;neo. La cocina es amplia, con un dise&ntilde;o abierto hacia el sal&oacute;n, y el &aacute;rea de comedor tiene grandes ventanas y acceso a la terraza. Las habitaciones est&aacute;n en un &aacute;rea independiente, ambas con orientaci&oacute;n al sur, y con posibilidad de incluir accesos directos a la terraza desde las habitaciones. Este &aacute;rea independiente la completa un ba&ntilde;o y un espacio de lavado.<br />\r\n	<br />\r\n	El &aacute;tico tiene una terraza-solarium privada de 43 metros cuadrados, con vistas al sur y al oeste. En esta terraza se disfrutan de espectaculares vistas al mar Mediterr&aacute;neo y a las monta&ntilde;as al norte de Torrox.<br />\r\n	<br />\r\n	La ubicaci&oacute;n permite disfrutar de las playas de Torrox Costa,que se encuentran a tan s&oacute;lo 50m., con la tranquilidad de estar en la zona de El Pe&ntilde;oncillo, y a solo 5 minutos de bancos, supermercados y todos los servicios necesarios.</p>\r\n</span></p>\r\n</div>\r\n<div>\r\n	&nbsp;</div>\r\n', '2017-07-01', 5, 1, 0);
