(2, 'Test de Cartel', 3, '<p>\r\n	<small class="col-sm-4"><strong>Datos General:</strong> </small></p>\r\n<ul>\r\n	<li>\r\n		<small class="col-sm-4">%general.f_actual_numero%: Fecha actual en formato num&eacute;rico</small></li>\r\n	<li>\r\n		<small class="col-sm-4">%general.f_actual_texto%: Fecha actual en formato texto</small></li>\r\n</ul>\r\n<div>\r\n	<small class="col-sm-4"><strong><small class="col-sm-4"><strong>Datos Inmuebles:</strong> </small></strong></small>\r\n	<ul>\r\n		<li>\r\n			<small class="col-sm-4">%inmuebles.referencia%: Referencia del inmueble</small></li>\r\n		<li>\r\n			<small class="col-sm-4">%inmuebles.fecha_alta%: Fecha de alta del inmueble</small></li>\r\n		<li>\r\n			<small class="col-sm-4">%inmuebles.nombre_tipo%: Tipo del inmueble</small></li>\r\n		<li>\r\n			<small class="col-sm-4">%inmuebles.nombre_provincia%: Nombre de la provincia</small></li>\r\n		<li>\r\n			<small class="col-sm-4">%inmuebles.nombre_poblacion%: Nombre del municipio</small></li>\r\n		<li>\r\n			<small class="col-sm-4">%inmuebles.nombre_zona%: Nombre de la zona del municipio</small></li>\r\n		<li>\r\n			<small class="col-sm-4">%inmuebles.direccion%: Direcci&oacute;n real del inmueble</small></li>\r\n		<li>\r\n			<small class="col-sm-4">%inmuebles.metros%: Metros totales</small></li>\r\n		<li>\r\n			<small class="col-sm-4">%inmuebles.metros_utiles%: Metros &uacute;tiles</small></li>\r\n		<li>\r\n			<small class="col-sm-4">%inmuebles.habitaciones%: N&uacute;mero de habitaciones</small></li>\r\n		<li>\r\n			<small class="col-sm-4">%inmuebles.banios%: N&uacute;mero de ba&ntilde;os</small></li>\r\n		<li>\r\n			<small class="col-sm-4">%inmuebles.precio_compra%: Precio de compra</small></li>\r\n		<li>\r\n			<small class="col-sm-4">%inmuebles.precio_compra_anterior%: Precio de compra anterior</small></li>\r\n		<li>\r\n			<small class="col-sm-4">%inmuebles.precio_alquiler%: Precio alquiler</small></li>\r\n		<li>\r\n			<small class="col-sm-4">%inmuebles.precio_alquiler_anterio